\title{Zero-Shot Synthetic PolyRule Reasoning\\ with Neural Symbolic Integration}

\author{Anonymous}

\begin{document}

\maketitle

\begin{abstract}
We propose a method for zero-shot Synthetic PolyRule Reasoning (SPR) by integrating neural networks with symbolic reasoning frameworks. Our neural-symbolic model can infer and apply novel rules without additional training, enabling it to generalize to complex unseen tasks. We evaluate on the SPR\_BENCH dataset, where results reveal substantial gaps between validation performance and true generalization. While validation measures reach near 1.0 accuracy, test outcomes around 70\% highlight real pitfalls when new symbolic rules arise. This underscores both the potential and challenges of zero-shot neural-symbolic systems in practical reasoning contexts.
\end{abstract}

\section{Introduction}
Deep learning has brought remarkable progress to many fields \citep{goodfellow2016deep}, yet the robust integration of neural models with symbolic reasoning remains a challenge \citep{tsamoura2020neuralsymbolicia,wu2025nesygeoan}. Zero-shot reasoning tasks demand that models adapt to novel rules or symbolic structures that were not part of the training phase \citep{kojima2022largelm,dave2024investigatingsc}. Our goal is to explore whether a neural-symbolic framework can be extended to Synthetic PolyRule Reasoning (SPR), wherein both shapes and colors define rule-based classification. 

The appeal of a hybrid approach lies in the potential to efficiently incorporate knowledge-driven constraints without sacrificing the adaptability of neural methods \citep{kodnongbua2024zeroshotsn}. However, bridging the gap between apparent validation success and real-world generalization is prone to ambiguity. Our experiments show strong validation performance but only moderate test success, revealing an important shortcoming. We hope that highlighting these discrepancies will aid researchers in refining zero-shot and neuro-symbolic approaches further.

\section{Related Work}
Earlier studies have underlined the importance of zero-shot adaptation in symbolic tasks. Large language models can exhibit strong zero-shot reasoning under chain-of-thought prompting \citep{kojima2022largelm}, but suffer when symbolic reasoning complexity escalates \citep{dave2024investigatingsc}. Other neuro-symbolic work has demonstrated improvements in compositional generalization \citep{chen2020compositionalgv} and reinforcement learning \citep{amador2025symdqnsk}. Although these advances show promise, unresolved challenges remain in reliably scaling to complicated rule-based scenarios. Our work follows attempts to integrate neural encoders with symbolic modules \citep{tsamoura2020neuralsymbolicia} but emphasizes the mismatch between in-distribution validation outcomes and zero-shot test results in SPR.

\section{Method}
We investigate SPR using a two-stage neural-symbolic model combining a neural network feature extractor with a symbolic inference component. The neural portion encodes sequences of shape-color tokens. A symbolic reasoner attempts to apply the extracted representation to rule inference. We adopt code and data utilities that load the SPR\_BENCH dataset. We employ standard cross-entropy objectives and measure accuracy, shape-weighted accuracy (SWA), and color-weighted accuracy (CWA). Unlike standard classification, SWA and CWA weight correctness by the variety of shapes or colors, thereby exposing the model's sensitivity to nuanced symbolic changes.

\section{Experiments}
We train a gated recurrent unit (GRU) classifier on a portion of SPR\_BENCH using up to 20 epochs of training with early stopping. \Cref{fig:baseline_fig1} shows the rapid drop in training and validation loss and the corresponding near-perfect validation accuracy. Nevertheless, test scores remain modest in \Cref{fig:baseline_fig2}, revealing a notable gap when new rules appear. Specifically, final test accuracy is 0.7005, test SWA is 0.6529, and test CWA is 0.700969. Although shape-based reasoning appears slightly weaker, the model still achieves 0.757812 in novel rule generalization score (NRGS), indicating partial success. The confusion matrix underscores misclassifications, hinting at potential overconfidence for novel symbolic structures.

\begin{figure}[t]
\centering
\includegraphics[width=0.49\textwidth]{baseline_loss_and_val_accuracy.png}
\caption{Training/validation loss and validation accuracy on SPR\_BENCH. The validation accuracy plateaus near 1.0, suggesting overfitting or insufficient generalization.}
\label{fig:baseline_fig1}
\end{figure}

\begin{figure}[t]
\centering
\includegraphics[width=0.49\textwidth]{baseline_test_metrics_and_confusion.png}
\caption{Test metrics and confusion matrix on SPR\_BENCH. Accuracy, SWA, and CWA show moderate performance, misaligned with validation success.}
\label{fig:baseline_fig2}
\end{figure}

\section{Conclusion}
Our experiments highlight both promise and pitfalls in zero-shot SPR. A neural-symbolic approach can learn shape- and color-based rules from limited data, achieving near-perfect validation metrics. However, an evident performance drop on unseen rules exposes a persistent gap. We suggest future research explore enhanced symbolic interpretability to help reduce misclassifications and mitigate overconfidence on new rules. Deeper integration strategies may further unlock the potential of neural-symbolic systems for challenging zero-shot reasoning tasks.

\bibliography{references}
