\appendix
\section*{\LARGE Supplementary Material}
\section{Ablations and Additional Results}
We explored additional modifications, including a multi-dataset training strategy, CLS-token pooling, removal of positional embeddings, and bag-of-embeddings baselines. Figures~\ref{fig:ablation_multidataset}--\ref{fig:ablation_boe} summarize these ablations. While some variants affect validation metrics, zero-shot test performance remains difficult to maintain with novel rules. These results underscore the complexities of symbolic generalization and the need for more robust inference components.

\begin{figure}[h]
\centering
\includegraphics[width=0.65\textwidth]{ablation_multidataset.png}
\caption{Multi-dataset training ablation. Training and validation performance stabilize, yet confusion matrices reveal misclassifications in held-out data.}
\label{fig:ablation_multidataset}
\end{figure}

\begin{figure}[h]
\centering
\includegraphics[width=0.65\textwidth]{ablation_cls_token_pooling.png}
\caption{CLS-token pooling ablation, showing loss curves, validation SWA, and confusion matrix. These architectural choices can aid training but do not guarantee stronger zero-shot symbolic reasoning.}
\label{fig:ablation_cls}
\end{figure}

\begin{figure}[h]
\centering
\includegraphics[width=0.65\textwidth]{ablation_no_positional_embedding.png}
\caption{No-positional-embedding ablation. Validation metrics remain consistent, but confusion matrices indicate persistent errors on unseen rules.}
\label{fig:ablation_npe}
\end{figure}

\begin{figure}[h]
\centering
\includegraphics[width=0.65\textwidth]{ablation_bag_of_embeddings.png}
\caption{Bag-of-embeddings ablation. Simpler architectures excel on known tasks but lag on new SPR rule sets.}
\label{fig:ablation_boe}
\end{figure}

\subsection{Hyperparameters}
All models were trained using the Adam optimizer with a learning rate of $10^{-3}$ and a batch size of 64. We ran training for up to 20 epochs, employing early stopping if the validation accuracy did not improve for 3 consecutive epochs. 

